import React, { useEffect, useRef } from 'react';
import styled from 'styled-components';

const BackgroundContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  z-index: 0;
  pointer-events: none;
  overflow: hidden;
  background: linear-gradient(135deg, #0a0a0a 0%, #1a1a1a 50%, #2d2d2d 100%);
`;

const Canvas = styled.canvas`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
`;

const AnimatedBackground = () => {
  const canvasRef = useRef(null);
  const animationRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    // Set canvas size
    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };

    resizeCanvas();
    window.addEventListener('resize', resizeCanvas);

    // Fintech symbols and elements
    const symbols = [
      { type: 'text', value: 'â‚¹', color: '#00d4ff', size: 36 },
      { type: 'text', value: 'â‚¹', color: '#ffffff', size: 28 },
      { type: 'text', value: 'â‚¹', color: '#667eea', size: 32 },
      { type: 'text', value: '$', color: '#00d4ff', size: 30 },
      { type: 'text', value: '%', color: '#ffffff', size: 26 },
      { type: 'text', value: 'ðŸ’³', color: '#00d4ff', size: 24 },
      { type: 'text', value: 'ðŸ“Š', color: '#667eea', size: 28 },
      { type: 'text', value: 'ðŸ“ˆ', color: '#ffffff', size: 26 },
      { type: 'text', value: 'ðŸ’°', color: '#00d4ff', size: 30 },
    ];

    // Create floating elements
    const floatingElements = Array.from({ length: 20 }, () => {
      const symbol = symbols[Math.floor(Math.random() * symbols.length)];
      return {
        ...symbol,
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        speed: 0.3 + Math.random() * 0.5,
        alpha: 0.1 + Math.random() * 0.2,
        dx: -0.2 + Math.random() * 0.4,
        dy: -0.2 + Math.random() * 0.4,
        scale: 0.8 + Math.random() * 0.4,
        rotation: Math.random() * Math.PI * 2,
        rotationSpeed: (Math.random() - 0.5) * 0.02,
      };
    });

    // Animation function
    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      floatingElements.forEach(element => {
        ctx.save();

        // Set position and transformations
        ctx.translate(element.x, element.y);
        ctx.rotate(element.rotation);
        ctx.scale(element.scale, element.scale);
        ctx.globalAlpha = element.alpha;

        // Draw the element
        ctx.font = `bold ${element.size}px 'JetBrains Mono', monospace`;
        ctx.fillStyle = element.color;
        ctx.textAlign = 'center';
        ctx.textBaseline = 'middle';
        ctx.fillText(element.value, 0, 0);

        ctx.restore();

        // Update position
        element.y -= element.speed;
        element.x += element.dx;
        element.rotation += element.rotationSpeed;

        // Reset position when element goes off screen
        if (element.y < -50) {
          element.y = canvas.height + 50;
          element.x = Math.random() * canvas.width;
        }

        if (element.x < -50) {
          element.x = canvas.width + 50;
        }
        if (element.x > canvas.width + 50) {
          element.x = -50;
        }
      });

      // Draw connecting lines between nearby elements
      ctx.strokeStyle = 'rgba(0, 212, 255, 0.1)';
      ctx.lineWidth = 1;

      for (let i = 0; i < floatingElements.length; i++) {
        for (let j = i + 1; j < floatingElements.length; j++) {
          const dx = floatingElements[i].x - floatingElements[j].x;
          const dy = floatingElements[i].y - floatingElements[j].y;
          const distance = Math.sqrt(dx * dx + dy * dy);

          if (distance < 150) {
            ctx.beginPath();
            ctx.moveTo(floatingElements[i].x, floatingElements[i].y);
            ctx.lineTo(floatingElements[j].x, floatingElements[j].y);
            ctx.stroke();
          }
        }
      }

      animationRef.current = requestAnimationFrame(animate);
    };

    animate();

    // Cleanup
    return () => {
      window.removeEventListener('resize', resizeCanvas);
      if (animationRef.current) {
        cancelAnimationFrame(animationRef.current);
      }
    };
  }, []);

  return (
    <BackgroundContainer>
      <Canvas ref={canvasRef} />
    </BackgroundContainer>
  );
};

export default AnimatedBackground;
